function randomByte() {
    var buffer = new Uint8Array(1);
    crypto.getRandomValues(buffer);
    return buffer[0];
}

function pickWord() {
    var index = 0;
    do {
        index = (randomByte() << 8) | randomByte();
    } while (index >= CZECH_WORDS.length);
    return CZECH_WORDS[index];
}

function update() {
    if (!/^[0-9]*$/.test(document.getElementById('count').value)) {
        document.getElementById('count').value = 0;
    }
    var count = Number(document.getElementById('count').value) || 0;
    var words = Array(count).fill(0).map(pickWord).join('-');
    document.getElementById('output').value = words;
    document.getElementById('enthropy').value = `${count * 15} bit≈Ø`;
}
